import React from "react"


function App(){

 const date = new Date();
 const time = date.getTime();
 let timeOfDay;
 if(time<12)
    timeOfDay = "Good Morning!!"
 else if(time>12 && time <18)
    timeOfDay = "Good Evening..!"
 else if(time>18)
    timeOfDay = "Good Night..!"
 return (
     <div>
       timeOfDay
     </div>
 )
}

export default App
